import Banner from "../../components/Banner";
import Card from "../../components/Card";
import { data } from '../../data/logement'

function Home() {
  return (
    <div>
    <Banner />
      <section className="card">
          {data.map((data) => {
            return ( 
              <Card key={data.id} id={data.id} cover={data.cover} title={data.title} />
          )})}
      </section>
    </div>
  );
}

export default Home;
